// --------------------------------------------------------------
// Runtime
//
// Used in the interpretation phase for the interpreter
// --------------------------------------------------------------
struct Runtime {
  // Current function's prototype
  Prototype** cur;
  // Current function's closure object
  Closure**   curcls;

  Script** script;
  Object** global;
  Value ret;
  std::string* error;
  std::uint64_t stack[1024];

  Runtime( const Handle<Script>& script , const Handle<Object>& glb ,
                                          std::string* err ):
    cur     (script->main().ref()),
    script  (script.ref()),
    global  (glb.ref()),
    ret     (),
    error   (err),
    stack   ()
  {}
};
static_assert( std::is_standard_layout<Runtime>::value );

struct RuntimeLayout {
  static const std::uint32_t kCurProtoOffset = offsetof(Runtime,cur);
  static const std::uint32_t kCurClsOffset   = offsetof(Runtime,curcls);
  static const std::uint32_t kRetOffset = offsetof(Runtime,ret);
};


